import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";

export const ListOrder = {
  left: "flex-start",
  center: "center",
  right: "flex-end",
  between: "space-between",
};

const List = ({
  children,
  className = "",
  card = false,
  width = "100%",
  order = ListOrder.left,
}) => {
  return (
    <Styled.List className={className} card={card} order={order} width={width}>
      {children}
    </Styled.List>
  );
};

List.propTypes = {
  children: propTypes.node.isRequired,
  className: propTypes.string,
  card: propTypes.bool,
  width: propTypes.string,
  order: propTypes.string,
};

export default List;
